function Navbar(){
  return ( 
    <div className='py-4 bg-white'>
    <div className='max-w-6xl flex justify-between items-centre mx-auto'>
<img className="h-16" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRkdbrYLIeQePgarZXswZqblOreqspDQ35fsnUh08pd&s"/>
<div className="flex flex-col-center" >
<HiLockClosed className="text-4xl text-red-700"/>

</div>
    </div>
    
    </div>
    )
}

export default Navbar;
